import React from "react";
import Search from "./components/navbar/Search";
import Main from "./components/main";
import { Card } from "@nextui-org/react";
// import "./styles.css";

export default function App() {
  return (
    <div className="App">
      <Search />
      <Card
        css={{ width: "70%", backgroundImage: 'url("https://unsplash.com/photos/yo01Z-9HQAw/download?ixid=MnwxMjA3fDB8MXxzZWFyY2h8N3x8aG9zcGl0YWx8ZW58MHx8fHwxNjU0NzkxMDU0&force=true")', backgroundSize: "80% 100%", marginLeft: "15%" }}
      >
        <Card.Body>
          <Main />
        </Card.Body>
      </Card>
    </div>
  );
}
